import React, { useState } from 'react';

interface ProjectRequest {
  contractorCompany: string;
  contactEmail: string;
  propertyAddress: string;
  serviceType: 'INSPECTION' | 'ESTIMATE' | 'FULL_REPORT';
  roofType: string;
  estimatedSquareFeet: number;
  urgency: 'STANDARD' | 'PRIORITY' | 'EMERGENCY';
  description?: string;
}

const ProjectRequestPage: React.FC = () => {
  const [request, setRequest] = useState<ProjectRequest>({
    contractorCompany: '',
    contactEmail: '',
    propertyAddress: '',
    serviceType: 'INSPECTION',
    roofType: '',
    estimatedSquareFeet: 0,
    urgency: 'STANDARD',
    description: ''
  });

  const [calculatedFee, setCalculatedFee] = useState<number>(0);
  const [showPayment, setShowPayment] = useState(false);

  const calculateFee = () => {
    let baseFee = 150; // Base inspection fee

    // Service type multipliers
    const serviceMultipliers = {
      'INSPECTION': 1.0,
      'ESTIMATE': 1.5,
      'FULL_REPORT': 2.0
    };

    // Urgency multipliers
    const urgencyMultipliers = {
      'STANDARD': 1.0,
      'PRIORITY': 1.5,
      'EMERGENCY': 2.0
    };

    // Size-based fee
    const sizeFee = Math.max(0, (request.estimatedSquareFeet - 1000) * 0.10);

    const totalFee = (baseFee + sizeFee) * 
                    serviceMultipliers[request.serviceType] * 
                    urgencyMultipliers[request.urgency];

    setCalculatedFee(Math.round(totalFee * 100) / 100);
    setShowPayment(true);
  };

  const submitRequest = () => {
    // This would integrate with payment processor (Stripe/Square)
    console.log('Submitting request with payment:', { request, fee: calculatedFee });
    alert(`Request submitted! Fee: $${calculatedFee} - Payment integration needed.`);
  };

  return (
    <div className="p-8 max-w-4xl mx-auto">
      <h1 className="text-3xl font-bold mb-6">Request Roofing Inspection Service</h1>

      <div className="bg-white rounded-lg shadow p-6">
        <div className="grid grid-cols-1 md:grid-cols-2 gap-6">
          {/* Contractor Info */}
          <div>
            <label className="block text-sm font-medium mb-2">Company Name</label>
            <input
              type="text"
              className="w-full border rounded px-3 py-2"
              value={request.contractorCompany}
              onChange={(e) => setRequest({...request, contractorCompany: e.target.value})}
            />
          </div>

          <div>
            <label className="block text-sm font-medium mb-2">Contact Email</label>
            <input
              type="email"
              className="w-full border rounded px-3 py-2"
              value={request.contactEmail}
              onChange={(e) => setRequest({...request, contactEmail: e.target.value})}
            />
          </div>

          {/* Property Info */}
          <div className="md:col-span-2">
            <label className="block text-sm font-medium mb-2">Property Address</label>
            <input
              type="text"
              className="w-full border rounded px-3 py-2"
              value={request.propertyAddress}
              onChange={(e) => setRequest({...request, propertyAddress: e.target.value})}
            />
          </div>

          <div>
            <label className="block text-sm font-medium mb-2">Service Type</label>
            <select
              className="w-full border rounded px-3 py-2"
              value={request.serviceType}
              onChange={(e) => setRequest({...request, serviceType: e.target.value as any})}
            >
              <option value="INSPECTION">Inspection Only ($150 base)</option>
              <option value="ESTIMATE">Inspection + Estimate (+50%)</option>
              <option value="FULL_REPORT">Full Report Package (+100%)</option>
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium mb-2">Urgency</label>
            <select
              className="w-full border rounded px-3 py-2"
              value={request.urgency}
              onChange={(e) => setRequest({...request, urgency: e.target.value as any})}
            >
              <option value="STANDARD">Standard (2-3 days)</option>
              <option value="PRIORITY">Priority (+50%, next day)</option>
              <option value="EMERGENCY">Emergency (+100%, same day)</option>
            </select>
          </div>

          <div>
            <label className="block text-sm font-medium mb-2">Roof Type</label>
            <input
              type="text"
              className="w-full border rounded px-3 py-2"
              placeholder="Asphalt shingle, Metal, Tile, etc."
              value={request.roofType}
              onChange={(e) => setRequest({...request, roofType: e.target.value})}
            />
          </div>

          <div>
            <label className="block text-sm font-medium mb-2">Estimated Square Feet</label>
            <input
              type="number"
              className="w-full border rounded px-3 py-2"
              value={request.estimatedSquareFeet}
              onChange={(e) => setRequest({...request, estimatedSquareFeet: parseInt(e.target.value) || 0})}
            />
          </div>
        </div>

        <div className="mt-6">
          <label className="block text-sm font-medium mb-2">Additional Details</label>
          <textarea
            className="w-full border rounded px-3 py-2"
            rows={3}
            value={request.description}
            onChange={(e) => setRequest({...request, description: e.target.value})}
          />
        </div>

        <div className="mt-6 flex gap-4">
          <button
            onClick={calculateFee}
            className="bg-blue-600 text-white px-6 py-2 rounded hover:bg-blue-700"
          >
            Calculate Service Fee
          </button>
        </div>

        {showPayment && (
          <div className="mt-6 p-4 bg-gray-50 rounded">
            <h3 className="text-lg font-semibold mb-2">Service Fee: ${calculatedFee}</h3>
            <p className="text-sm text-gray-600 mb-4">
              Payment is required before your project enters our work queue.
            </p>
            <button
              onClick={submitRequest}
              className="bg-green-600 text-white px-6 py-2 rounded hover:bg-green-700"
            >
              Pay ${calculatedFee} & Submit Request
            </button>
          </div>
        )}
      </div>
    </div>
  );
};

export default ProjectRequestPage;
